import React from 'react';
import { View, Text, TouchableOpacity, TextInput } from 'react-native';
//import style from './style.js';

export default function login({ navigation }) {
    return (
        <View>
            <View>
                <Text>Login:</Text>
                <TextInput placeholder="login"/>
            </View>
            <View>
                <Text>Senha:</Text>
                <TextInput passowd={true}/>
            </View>
                <TouchableOpacity>
                    <Text>Entrar</Text>
                </TouchableOpacity>
        </View>
    );
}
